instance.peoplecode_text:
/*********************************************************/
/** PeoopleTools Tech Tips     	      	        	**/
/** Randy Groncki 2021-03-18          	                **/
/** peopletoolstechtips@gmail.com                       **/
/** Design Time Images                                  **/
/** Hide the empty result grid				**/
/*********************************************************/

GetLevel0()(1).X_IMAGE_WRK.GROUPBOX1.Visible = False;

/*********************************************************/
/** PeoopleTools Tech Tips     	        		**/
/** Randy Groncki 2021-03-18          	                **/
/** peopletoolstechtips@gmail.com                       **/
/** Design Time Images                                  **/
/** Load Row Image Name into HTML Field		  	**/
/*********************************************************/

Local Field &Fld_Html_Area = GetRow().GetRecord(Record.X_IMAGE_WRK).HTMLAREA;
Local Field &Fld_ContName = GetRow().GetRecord(Record.X_CONT_IMAGE_VW).CONTNAME;

&Fld_Html_Area.Value = "<img src='%Image(" | &Fld_ContName.Value | ")'/> ";

/*********************************************************/
/** PeoopleTools Tech Tips     	      	        	**/
/** Randy Groncki 2021-03-18          	                **/
/** peopletoolstechtips@gmail.com                       **/
/** Design Time Images                                  **/
/** Images of Type					**/
/*********************************************************/
Local Rowset &RS_X_CONT_IMAGE_VW = GetLevel0()(1).GetRowset(Scroll.X_CONT_IMAGE_VW);
Local Field &Fld_X_Image_Type = GetRecord().GetField(Field.X_IMAGE_TYPE);
Local Field &Fld_Image_Name = GetRecord().GetField(Field.IMAGE_NAME);
Local Field &Fld_Image_Descr = GetRecord().GetField(Field.DESCR);
Local Field &Fld_Groupbox = GetLevel0()(1).X_IMAGE_WRK.GROUPBOX1;
Local string &Str_Image_Name = RTrim(&Fld_Image_Name.Value);
Local string &Str_Image_Descr = Upper(RTrim(&Fld_Image_Descr.Value));
Local integer &Int_Num_Imgages_Found;

If None(&Str_Image_Name) Or
      &Str_Image_Name = "%" Then
   &Str_Image_Name = "%";
Else
   &Str_Image_Name = "%" | Upper(&Str_Image_Name) | "%";
End-If;

If None(&Str_Image_Descr) Or
      &Str_Image_Descr = "%" Then
   &Str_Image_Descr = "%";
Else
   &Str_Image_Descr = "%" | Upper(&Str_Image_Descr) | "%";
End-If;



&RS_X_CONT_IMAGE_VW.Flush();
&Int_Num_Imgages_Found = &RS_X_CONT_IMAGE_VW.Select(Record.X_CONT_IMAGE_VW, "where UPPER(CONTFMT) LIKE :1 and UPPER(CONTNAME) LIKE :2 AND upper(DESCR) LIKE :3", &Fld_X_Image_Type.ShortTranslateValue, &Str_Image_Name, &Str_Image_Descr);

If None(&Int_Num_Imgages_Found) Then
   &Fld_Groupbox.Visible = False;
Else
   &Fld_Groupbox.Visible = True;
End-If;
